/*
 * LZW Compression/Decompression for Strings lifted from 
 * http://rosettacode.org/wiki/LZW_compression#JavaScript
 */
var LZW = {
    compress: function (uncompressed) {
        "use strict";
        // Build the dictionary.
        var i,
            dictionary = {},
            c,
            wc,
            w = "",
            result = [],
            dictSize = 256;
        for (i = 0; i < 256; i += 1) {
            dictionary[String.fromCharCode(i)] = i;
        }
 
        for (i = 0; i < uncompressed.length; i += 1) {
            c = uncompressed.charAt(i);
            wc = w + c;
            //Do not use dictionary[wc] because javascript arrays 
            //will return values for array['pop'], array['push'] etc
            // if (dictionary[wc]) {
            if (dictionary.hasOwnProperty(wc)) {
                w = wc;
            } else {
                result.push(dictionary[w]);
                // Add wc to the dictionary.
                dictionary[wc] = dictSize++;
                w = String(c);
            }
        }
 
        // Output the code for w.
        if (w !== "") {
            result.push(dictionary[w]);
        }
        return result;
    },
 
 
    decompress: function (compressed) {
        "use strict";
        // Build the dictionary.
        var i,
            dictionary = [],
            w,
            result,
            k,
            entry = "",
            dictSize = 256;
        for (i = 0; i < 256; i += 1) {
            dictionary[i] = String.fromCharCode(i);
        }
 
        w = String.fromCharCode(compressed[0]);
        result = w;
        for (i = 1; i < compressed.length; i += 1) {
            k = compressed[i];
            if (dictionary[k]) {
                entry = dictionary[k];
            } else {
                if (k === dictSize) {
                    entry = w + w.charAt(0);
                } else {
                    return null;
                }
            }
 
            result += entry;
 
            // Add w+entry[0] to the dictionary.
            dictionary[dictSize++] = w + entry.charAt(0);
 
            w = entry;
        }
        return result;
    }
};

/*
 * Write the pixels associated with osb to the local disk.
 * Image manipulation technology from Larry Serflaten. See 
 * https://www.khanacademy.org/cs/applytransparencymask-function/1365850885
 */
var savePlate = function(osb) {
    var i, j;
    var bits = osb.get();
    var src = bits.sourceImg;
    var ctx = src.getContext("2d");
    var ary = ctx.getImageData(0, 0, osb.width, osb.height);
    var pixels = [];
    /* repack individual r,g,b,o components into 32 bit colors */
    for (j = i = 0; i < ary.data.length; j++) {
        pixels[j] = (ary.data[i++] << 16) | (ary.data[i++] << 8) |
            ary.data[i++] | (ary.data[i++] << 24);
    }
    var s = osb.json.stringify(pixels);
    var cs = LZW.compress(s);
    var scs = osb.json.stringify(cs);
    if (s && scs) {
        osb.ls.setItem(osb.lsKey, scs);
        println("The image has been saved to your disk. To");
        println("incorporate the image into the Javascript source,");
        println("copy & paste the following (very long) line:");
        println("var myPlate = '" + scs + "';");
        println(scs.length + " bytes");
    }
};

/* 
 * Reload an older plate's image, either from the "myPlate" variable,
 * or from the disk (in two different formats), or from nowhere at all.
 */
var reloadPlate = function(osb) {
    var i, j, p, cs, pixels;
    /* Load the encoded image from "myPlate" or from localStorage */
    var scs = (myPlate) ? myPlate : osb.ls.getItem(osb.lsKey);

    /* Attempt to parse the encoding */ 
    try {
        cs = osb.json.parse(scs);
    } catch (anything) {
        debug("first parse failed", anything);
        return;
    }
    if (cs === undefined || cs === null) {
        return;
    }
    
    /* Attempt to decompress what was parsed. */
    var s = LZW.decompress(cs);
    if (typeof s === "string") {
        try {
            /* Now parse the decompressed string. */
            pixels = osb.json.parse(s);
        } catch (anything) {
            debug("second parse failed", anything);
        }
    }
    if (pixels === undefined) {
        /* Assume that we did not need decompression... */
        pixels = cs;
    }
    
    /* Shove the pixels back intp the image's data array. */
    var bits = osb.get();
    var src = bits.sourceImg;
    var ctx = src.getContext("2d");
    var ary = ctx.getImageData(0, 0, osb.width, osb.height);
    for (j = i = 0; i < pixels.length; i++) {
        p = pixels[i];
        ary.data[j++] = (p >> 16) & 255;
        ary.data[j++] = (p >> 8) & 255;
        ary.data[j++] = (p) & 255;
        ary.data[j++] = (p >> 24) & 255;
    }
    ctx.putImageData(ary, 0, 0);
    osb.imageMode(CENTER);
    osb.image(bits, 0, 0);
    osb.imageMode(CORNER);  /* NB: osb push/pop style seems broken */
};

/* Reset the spinning plate */
var reset_osb = function(osb) {
    osb.pushStyle();
    var rad = osb.radius;
    osb.background(0, 0, 0, 0);  /* transparent */
    osb.fill(buttons[buttons.length-1].selectFill);
    osb.stroke(plateEdgeColor);
    osb.strokeWeight(1);
    osb.ellipse(0, 0, 2*rad, 2*rad);
    for (var i = 0; i < 15; i++) {
        var r = random(0.98*rad, rad);
        var t = random(0, 360);
        osb.fill(214, 220, 133);
        osb.ellipse(r*cos(t), r*sin(t), 5, 3);
    }
    osb.ellipse(0, 0, 5, 3);
    osb.popStyle();
};

/*
 * Return an off-screen-graphics-buffer that
 * holds a plate of radius rad.
 */
var get_osb = function(rad) {
    if (get_osb.osb) {
        return get_osb.osb;  /* cached! */
    }
    var osb = createGraphics(2 * (rad + 1), 2 * (rad + 1), JAVA2D);
    if (osb) {
        osb.radius = rad;
        osb.beginDraw();
        osb.translate(rad + 1, rad + 1);
        reset_osb(osb);  /* create the plate osb */
        get_osb.osb = osb;  /* cache it */
        /* hook other goodies on here... */
        osb.json = (function(what) { return this[what]; })("JSON");
        osb.ls = (function(what) { return this[what]; })("localStorage");
        osb.lsKey = lsKey + "." + osb.width + "." + osb.height;
        reloadPlate(osb);  /* load old image from localStorage */
    }
    return osb;
};

/*
 * Place more paint on the spinning plate, osb. d is the distance of
 * of the cursor from the center of rotation.
 */
var paint = function(osb, d) {
    var gamma = atan2(mouseY - cy, mouseX - cx);
    var x = d * cos(gamma - theta);
    var y = d * sin(gamma - theta);
    osb.stroke(colour);
    if (dots) {
        osb.strokeWeight(2 * sWeight);
        osb.point(x, y);
    } else {
        if (paint.px !== undefined) {
            osb.strokeWeight(sWeight);
            osb.line(x, y, paint.px, paint.py);
        }
        paint.px = x;
        paint.py = y;
    }
    
    /* clean up paint that spilled over the edge... */
    if (d > radius - sWeight - 1) {
        osb.pushStyle();
        osb.strokeWeight(sWeight);
        osb.stroke(bgColor);
        osb.noFill();
        osb.ellipse(0, 0, 2*radius + sWeight, 2*radius + sWeight);
        osb.strokeWeight(1);
        osb.stroke(plateEdgeColor);
        osb.ellipse(0, 0, 2*radius, 2*radius);
        osb.popStyle();
    }
};

/* Called by Processing.js numerous times per second */
draw = function() {
    background(bgColor);
    
    /* button related updates */
    cWeight = undefined;
    button.updateButtons(buttons);  /* this may call cursorOver */
    
    /* Spinning plate */
    var osb = get_osb(radius);
    if (osb) {
        pushMatrix();
        translate(cx, cy);
        theta = (theta + dt) % 360;
        rotate(theta);
        var d = dist(mouseX, mouseY, cx, cy);
        if (myMouseIsPressed && d < radius) {
            paint(osb, d);
        } else {
           paint.px = paint.py = undefined; 
        }
        image(osb, 0, 0);
        popMatrix();
    }
    
    /* button related rendering */
    button.renderButtons(buttons);
    textSize(12);
    fill(0, 0, 0);
    /* Display the strokeWeight iff the mouse hovers over a color button */
    if (cWeight) {
        textAlign(LEFT, CENTER);
        text("    " + cWeight, mouseX, mouseY);
    }
    /* Display the rotational speed */
    textAlign(CENTER, CENTER);
    var sign = (dt > 0) ? "+": ((dt === 0) ? " " : "");
    text(sign + dt + " / Frame",
        buttons[plusButt].x, (buttons[plusButt].y + buttons[plusButt+1].y) / 2);
    /* Display the numer of undos that are available */
    if (undo.length > 0) {
        var b = buttons[2];
        text(undo.length, b.x + 1.5*b.radius, b.y);
    }
};

/* Make the first two buttons behave like radio buttons */
var radioButton = function(b, other) {
    b.holdFill = b.fill;
    b.holdHover = b.hoverFill;
    b.fill = b.hoverFill = b.selectFill;
    
    other.fill = other.holdFill;
    other.hoverFill = other.holdHover;
};

/* Call by the button software when the mouse is released over a button */
cursorReleased = function(b, i) {
    var osb = get_osb(radius);
    switch (i) {
        case 0:  /* henceforth, draw dots */
            if (! dots) {
                dots = true;
                radioButton(b, buttons[1]);
            }
            break;
        case 1:  /* henceforth, draw a line */
            if (dots) {
                dots = false;
                radioButton(b, buttons[0]);
            }
            break;
        case 2:  /* undo */
            var bits = undo.pop();
            if (bits) {
                osb.pushMatrix();
                osb.resetMatrix();
                osb.set(0, 0, bits);
                osb.popMatrix();
            }
            break;
        case 3:  /* reset */
            reset_osb(osb);
            undo = [];
            break;
        case 4:  /* save */
            savePlate(osb);
            break;
        case 5:  /* increase the rotational speed */
            if (dt >= 15 || dt < -15) {
                dt += 5;
            } else {
                dt++;
            }
            dt = min(dt, 180);
            break;
        case 6:  /* decrease the rotational speed */
            if (dt <= -15 || dt > 15) {
                dt -= 5;
            } else {
                dt--;
            }
            dt = max(dt, -180);
            break;
        default:  /* color/strokeWeight buttons */
            colour = b.selectFill;
            sWeight = max(round((mouseY - (b.y - b.radius + 6))/2), 1);
            break;
    }
};

/* Called by Processing.js when the mouse button is released. */
mousePressed = function() {
    myMouseIsPressed = true;
    if (dist(mouseX, mouseY, cx, cy) < radius) {
        /*
         * User begins to draw a line or line of dots.
         * Push the image's bits onto the undo stack.
         */
        var osb = get_osb();
        osb.pushMatrix();
        osb.resetMatrix();
        undo.push(osb.get());
        osb.popMatrix();
        if (undo.length > 50) {
           undo.shift();  /* do not keep expensive stack entries forever */
        }
    }
};

/* Called by Processing.js when the user releases the mouse button. */
mouseReleased = function () {
    myMouseIsPressed = false;
    /* 
     * Basic use of this Processingjs event-driven function.
     * Calls cursorReleased if a button was clicked.
     */
    for (var i = buttons.length; --i >= 0; ) {
        if (buttons[i].mouseOver()) {
            cursorReleased(buttons[i], i);
        }
    }
};

/* Called by the button software when the mouse hovers over a button. */
cursorOver = function (b, i) {
    if (i >= colorButt) {
        cWeight = max(round((mouseY - (b.y - b.radius + 6))/2), 1);
    }
};

/* Set the global varibales on program (re)start. */
var initialize = function() {
    lsKey = "SpinningPlateV1";
    LZW.compress(lsKey);
    myMouseIsPressed = false;
    bgColor = color(217, 204, 204);
    plateEdgeColor = color(217, 135, 67);
    cx = width/2;
    cy = height/2 - 30;
    theta = 0;
    dt = -8;
    radius = 160;
    plusButt = 5;
    colorButt = 7;
    dots = false;
    get_osb.osb = undefined;
    undo = [];
    imageMode(CENTER);
    
    buttons = button.initialize(buttonDescriptions);
    for (var i = colorButt; i < buttons.length; i++) {
        var c = buttons[i].fill;
        buttons[i].selectFill = c;
        buttons[i].hoverFill = color(red(c), green(c), blue(c), 100);
    }
    /* Set up first two button to be "radio" buttons */
    buttons[0].holdFill = buttons[1].holdFill = buttons[1].fill;
    buttons[0].holdHover = buttons[1].holdHover = buttons[1].hoverFill;
    if (dots) {
        radioButton(buttons[1], buttons[0]);
        radioButton(buttons[0], buttons[1]);
    } else {
        radioButton(buttons[0], buttons[1]);
        radioButton(buttons[1], buttons[0]);
    }
    colour = buttons[buttons.length - 2].selectFill;
    sWeight = 2;
};

